[environment]
WIND_HOME=/opt/tools/visar/WindRiver
WIND_BASE=%(WIND_HOME)s/vxworks-6.9
LINK_BIN_PRE=%(WIND_HOME)s/gnu/4.3.3-vxworks-6.9/x86-linux2/bin/ccppc
LINK_BIN_PRE_FLAGS=-r -nostdlib -Wl,-X -T %(WIND_BASE)s/target/h/tool/gnu/ldscripts/link.OUT
LINK_BIN_PRE_TO=-o
LINK_BIN_PRE_EXT_LIB=
LD_LIBRARY_PATH=%(WIND_HOME)s/setup/x86-linux2/lib
DUMP=%(WIND_HOME)s/gnu/4.3.3-vxworks-6.9/x86-linux2/powerpc-wrs-vxworks/bin/nm
MUNCH=%(WIND_HOME)s/setup/x86-linux2/bin/tclsh %(WIND_BASE)s/host/resource/hutils/tcl/munch.tcl -c ppc
CC_MUNCH=%(LINK_BIN_PRE)s -fdollars-in-identifiers -w
CFLAGS=-O3
COMPILE_ONLY=-c
COMPILE_TO=-o
LINK_BIN_POST=%(LINK_BIN_PRE)s
LINK_BIN_POST_FLAGS=-r -nostdlib -Wl,-X -T %(WIND_BASE)s/target/h/tool/gnu/ldscripts/link.OUT
LINK_BIN_POST_TO=-o
SYMBOL_CHECK=
SYMBOL_CHECK_FILE=
DEMANGLE=%(WIND_HOME)s/gnu/4.3.3-vxworks-6.9/x86-linux2/bin/c++filtppc
